        let rectangle2Rect = CGRect(x: frame.minX + fastFloor(frame.width * 0.00000 + 0.5), y: frame.minY + fastFloor(frame.height * 0.00000 + 0.5), width: fastFloor(frame.width * 1.00000 + 0.5) - fastFloor(frame.width * 0.00000 + 0.5), height: fastFloor(frame.height * 1.00000 + 0.5) - fastFloor(frame.height * 0.00000 + 0.5))
        let rectangle2Path = UIBezierPath(rect: rectangle2Rect)
        context.saveGState()
        rectangle2Path.addClip()
        context.drawLinearGradient(bkg,
            start: CGPoint(x: rectangle2Rect.midX, y: rectangle2Rect.maxY),
            end: CGPoint(x: rectangle2Rect.midX, y: rectangle2Rect.minY),
            options: [])
        context.restoreGState()
        UIColor.black.setStroke()
        rectangle2Path.lineWidth = 0.3
        rectangle2Path.stroke()
    }

